package dispatchersimport kotlinx.coroutines.*/** * We will get error that Module with the Main dispatcher is missing * It will work fine android project * so the output after commenting Main is * * Unconfined1 Dispatcher Thread: mainUnconfined2 Dispatcher Thread: kotlinx.coroutines.DefaultExecutorIO Dispatcher Thread: DefaultDispatcher-worker-1newSingleThreadContext Dispatcher Thread: MyThread */fun main() {    runBlocking {//        launch(Dispatchers.Main){//            println("Main Dispatcher Thread: ${Thread.currentThread().name}")//        }        launch(Dispatchers.Unconfined){            println("Unconfined1 Dispatcher Thread: ${Thread.currentThread().name}")            delay(100L)            println("Unconfined2 Dispatcher Thread: ${Thread.currentThread().name}")        }        launch(Dispatchers.IO){            println("IO Dispatcher Thread: ${Thread.currentThread().name}")        }        launch(newSingleThreadContext("MyThread")){            println("newSingleThreadContext Dispatcher Thread: ${Thread.currentThread().name}")        }    }}